import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ejemplo01';
}
<!-- Barra azul  -->
<div class="toolbar" role="banner">
  <img width="150" alt="Logo Cooperacion" src="/assets/img/cooperacion.png"/>
  <span class="titulo">Inventario IT</span>
</div>

<div class="container">
  <button class="btn btn-info"> Lista completa </button>
  <button class="btn btn-info" style="margin-left:10px"> Nuevo elemento </button>
</div>
